import { BrowserRouter, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import Home from './Home';
import AboutUs from './AboutUs';
import Contact from './Contact';
import Service from './Service';
import Service1 from './Service1';
import Service2 from './Service2';
import React, { Suspense } from 'react';
import Loader from './Loader';

const Home1 = React.lazy(() => {
  return new Promise(resolve => {
    setTimeout(()=>{
      resolve(import('./Home'))
    }, 2000)
  })
})

const AboutUs1 = React.lazy(() => {
  return new Promise(resolve => {
    setTimeout(()=>{
      resolve(import('./AboutUs'))
    }, 2000)
  })
})

const Contact1 = React.lazy(() => {
  return new Promise(resolve => {
    setTimeout(()=>{
      resolve(import('./Contact'))
    }, 2000)
  })
})

const Service11 = React.lazy(() => {
  return new Promise(resolve => {
    setTimeout(()=>{
      resolve(import('./Service'))
    }, 2000)
  })
})

function App() {
  return (
    <div className="App">
      <Suspense fallback={<Loader />}>
        <BrowserRouter>
          <Routes>
            <Route path='/' element={<Home1 />} />
            <Route path='/aboutus' element={<AboutUs1 />} />
            <Route path='/contact' element={<Contact1 />} />
            <Route path='/service' element={<Service11 />}>
              <Route path='/service/service1' element={<Service1 />} />
              <Route path='/service/service2' element={<Service2 />} />
            </Route>
          </Routes>
        </BrowserRouter>
      </Suspense>
    </div>
  );
}

export default App;
